import './styles.css';

function GameOutput(props) {

  const results = props

    GameOutput.defaultProps = {

      prop1: 'Default Value',
      prop2: 'Default Value',
      prop3: 'Default Value',
      prop4: 'Default Value',
      prop5: 'Default Value',
      prop6: 'Default Value',
      prop7: 'Default Value',
      prop8: 'Default Value',
    };



  return (
        <div className='game-output'>
          <div className="ref-output">
            <span className={`circle-input ${results[0]}`}></span>
            <span className={`circle-input ${results[1]}`}></span>
            <span className={`circle-input ${results[2]}`}></span>
            <span className={`circle-input ${results[3]}`}></span>
          </div>
          <div className="box-output">
            <span className={`circle-output ${results[4]}`}></span>
            <span className={`circle-output ${results[5]}`}></span>
            <span className={`circle-output ${results[6]}`}></span>
            <span className={`circle-output ${results[7]}`}></span>
          </div>
        </div>
  );
}

GameOutput.defaultProps = {

      prop1: 'Default Value',
      prop2: 'Default Value',
      prop3: 'Default Value',
      prop4: 'Default Value',
      prop5: 'Default Value',
      prop6: 'Default Value',
      prop7: 'Default Value',
      prop8: 'Default Value',
    };



export default GameOutput;
